import React from "react";

function ContactForm(){
    return(
        <div className="flex flex-col justify-center items-center w-[100%]">
            <form action="" className="w-[100%]">
                <div className="m-3 flex flex-col items-center">
                    <label>Email:</label>
                    <input type="email" placeholder="Enter your email address" required className="w-[80%]"/>
                </div>
                <div className="m-3 flex flex-col items-center">
                    <label>Message:</label>
                    <textarea name="" id="" placeholder="Type your message here..." required className="w-[80%] h-[70px]"></textarea>
                </div>
                <button>Send</button>
            </form>

        </div>
    );
}

export default ContactForm;
